import React from 'react';
import './styles/ActivateInfo/ActivateInfo.css'

const ActivateInfo = () => {
    return (
        <div className='ActivateInfo'>
            <div className="ActivateInfo__wrapper">
                <div className="info">Подтвердите свой адрес электронной почты, чтобы продолжить создание аккаунта, перейдя по ссылке отправленной на ваш Email: xxx@xxx.xxx .</div>
                <div className="logo"></div>
            </div>
        </div>
    );
};

export default ActivateInfo;
